dummy:
  function: dummy
  description: Dummy preprocessing
filter_range:
  function: filter_range
  description: Filter values between minimum and maximum values
  parameters:
    - name: column
      type: string
      description: Name of column to filter on.
      required: True
    - name: min_
      type: float
      description: Minimum value
      required: False
    - name: max_
      type: float
      description: Maximum value
      required: False
    - name: include_min
      type: bool
      description: Include minimum value
      required: False
      default: False
    - name: include_max
      type: bool
      description: Include maximum value
      required: False
      default: False
